import React, { useState } from 'react';
import './Navbar.css';

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  return (
    <header>
      <div className="top-bar">
        <div className="contact-info">
          <span><i className="fas fa-phone"></i> Office: (718)-200-0699</span>
          <span><i className="fas fa-mobile-alt"></i> Cell: (718)-300-7014</span>
          <span>30+ Years Experience | Fully Licensed | Fully Insured | MBE Certified Contractor</span>
        </div>
        <div className="free-estimate">
          <button>Free Estimate</button>
        </div>
      </div>
      <nav className={`main-nav ${isOpen ? "open" : ""}`}>
        <div className="menu-icon" onClick={toggleMenu}>
          <i className={`fas ${isOpen ? "fa-times" : "fa-bars"}`}></i>
        </div>
        <ul className="nav-links">
          <li><a href="#home">Home</a></li>
          <li><a href="#about">About Us</a></li>
          <li><a href="#resources">Resource Catalogs</a></li>
          <li className="dropdown">
            <a href="#services">Services</a>
            <ul className="dropdown-content">
              <li><a href="#service1">Service 1</a></li>
              <li><a href="#service2">Service 2</a></li>
            </ul>
          </li>
          <li><a href="#portfolio">Our Portfolio</a></li>
          <li><a href="#blog">Blog</a></li>
          <li><a href="#contact">Contact Us</a></li>
        </ul>
      </nav>
    </header>
  );
};

export default Navbar;
